import { useEffect, useState } from "react"
import SidebarGroup from "./SidebarGroup"
import { getEmployees, getProjects } from "../../api"

const Sidebar = () => {
    const [employees, setEmployees] = useState([])
    const [projects, setProjects] = useState([])
    const [error, setError] = useState(null)

    useEffect(() => {
        getEmployees()
            .then((response) => setEmployees(response.data))
            .catch((err) => {
                console.error("Error fetching employee list:", err)
                setError("Nie udało się pobrać listy pracowników")
            })
        
    }, [])
    return (
        <div className="sidebar">
            <h2 className="sidebar-title">WorkChrono</h2>
            <SidebarGroup title="Pracownicy" items={["Zadania", "Projekty", "Spotkania"]} />
            <SidebarGroup title="Projekty" items={["Zadania", "Projekty", "Spotkania"]} />
        </div>
    )
}

export default Sidebar
